    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;لدى الإقامة في فندق كنوز العمر في مكة المكرمة (شارع الستون)، ستكون على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق تضعك على بُعد ٣ كم من أبراج البيت  و٧٫٥ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك بالإقامة في واحدة من 147 غرفة مكيفة تتميز بوجود تلفزيون بشاشة مسطحة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الحمامات تجهيزات دش ومستلزمات مجانية للعناية الشخصية. تضم وسائل الراحة المتاحة هواتف وستائر تعتيم، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة مواقف سيارات قريبة مجانية وخدمة حمل الأمتعة ومناطق مخصصة للمدخنين.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة التي تقدمها المنشأة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة خدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة وفريق عمل يجيد التحدث بعدة لغات.&lt;/p&gt;",
