    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فور بوينتس باي شيراتون مكة النسيم في مكة المكرمة تضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٤٫٧ كم من مكة مول و ١٠٫٨ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;تمتع بالإقامة في واحدة من 1136 غرفة/غرف الضيافة التي تحتوي على تلفزيونات إل إي دي. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تضم وسائل الراحة خزنات وماكينات صنع القهوة/الشاي، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل صالة لياقة بدنية مفتوحة 24 ساعة أو تمتع بمشاهدة المنظر من الحديقة. في هذا الفندق، ستجد سماتٍ منها إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد. يمكن للنزلاء الانتقال إلى المواقع القريبة بكل سهولة مع خدمة الحافلة المكوكية المجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا واستمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال مفتوح 24 ساعة ومكتب استقبال مفتوح 24 ساعة ومصعد. تضم هذه المنشأة السياحية 7 غرف اجتماعات متاحة للمناسبات. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
