    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في هوليداي فيلا بكة في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق تضعك على بُعد ٦٫٢ كم من بئر زمزم و٨٫٧ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 140 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيونات إل إي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تحتوي حمامات خاصة على وحدات دش مع أحواض استحمام بها حوض استحمام عميق ومستلزمات فاخرة للعناية الشخصية. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات وغلايات كهربية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة خدمة حمل الأمتعة ومناطق مخصصة للمدخنين.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مكتب استقبال مفتوح 24 ساعة وخدمة تخزين الأمتعة وخزانة للأمانات في مكتب الاستقبال.&lt;/p&gt;",
