    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق أعيان الششة في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق تضعك على بُعد ٤٫٧ كم من بئر زمزم و٧٫٨ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 148 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيون إل سي دي. يتم توفير تلفاز بقنوات باشتراك مدفوع من أجل متعتك. تضم الحمامات تجهيزات دش ومستلزمات مجانية للعناية الشخصية. تضم وسائل الراحة المتاحة هواتف ومراوح، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق - حيث يُمنَع التدخين - تؤمّن المنشأة خدمة حمل الأمتعة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الراحة المتاحة مكتب استقبال مفتوح 24 ساعة ومصعد.&lt;/p&gt;",
