    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن موقع نزل شعيل في مكة المكرمة يضعك على بُعد 15 دقيقة بالسيارة من أبراج البيت  ومكة مول.   الإقامة في هذا الفندق تضعك على بُعد ١٥٫٥ كم من الكعبة و١٥٫٥ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 92 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيونات إل إي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية وخف للقدمين. تضم وسائل الراحة المتاحة هواتف ومراوح، وتتوفر خدمة تدبير الغرف أسبوعيًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة خدمة حمل الأمتعة ومناطق مخصصة للمدخنين.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;في هذا الفندق، يتم تقديم المأكولات في الكافيتيريا حيث يمكنك الاستمتاع بوجبة شهية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مكتب استقبال مفتوح 24 ساعة وخزانة للأمانات في مكتب الاستقبال ومصعد. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
