    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق النسور المهاجرين في مكة المكرمة تضعك على بُعد 15 دقيقة سيرا من أبراج البيت  وبوابة الملك فهد.  الإقامة في هذا الفندق تضعك على بُعد ١٠٫٨ كم من الكعبة و١٠٫٨ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 147 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيون إل سي دي. يتم توفير تلفاز بقنوات باشتراك مدفوع من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تضم وسائل الراحة المتاحة هواتف وخزنات، وتتوفر خدمة تدبير الغرف في أوقات محددة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة خدمة حمل الأمتعة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مكتب استقبال مفتوح 24 ساعة وخزانة للأمانات في مكتب الاستقبال ومصعد.&lt;/p&gt;",
