    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق الفيصل 1 في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق تضعك على بُعد ٥٫٣ كم من بئر زمزم و٨٫٨ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 300 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيون بشاشة مسطحة. قم بتحضير وجباتك بنفسك في المطبخ العام/المشترك. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات باشتراك مدفوع من أجل متعتك. تحتوي حمامات خاصة علىحوض استحمام عميق ومستلزمات مجانية للعناية الشخصية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;يتألّف مبنى هذا الفندق من 1 بناء واحد، وتؤمّن المنشأة أيضا مناطق مخصصة للمدخنين.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بوجبة في مطعم هذا الفندق، أو أقم هنا للاسترخاء والاستفادة من خدمة الغرف على مدار 24 ساعة. يتم تقديم إفطار أوروبي مجانًا يوميًا من 8 صباحاً إلى ظهراً.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة خدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة وفريق عمل يجيد التحدث بعدة لغات. يتم تأمين حافلة للتوصيل من وإلى المطار لقاء تكلفة إضافية (متوفرة على مدار 24 ساعة)، وتتوفر أيضا مواقف سيارات مجانية قائمة على الخدمة الذاتية في مقر المنشأة.&lt;/p&gt;",
