    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;لدى الإقامة في فندق مكة هيلتون للمؤتمرات في مكة المكرمة، ستكون على بُعد 4 دقيقة/دقائق بالسيارة من أبراج البيت  و6 دقيقة/دقائق من الكعبة.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٦ كم من الحرم المكي و ٦ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 764 غرفة/غرف ضيافة مكيفة، والتي تحتوي على ثلاجات ووحدات ميني بار. يتم توفير تلفزيون بشاشة مسطحة 49 بوصة تعرض قنوات بريميوم من أجل متعتك، بالإضافة إلى اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تضم الحمامات تجهيزات دش ومجففات شعر. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات تتّسع لتخزين الكمبيوتر المحمول ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل نادي صحي أو تمتع بالاستفادة من وسائل الترفيه الأخرى المتاحة مثل إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد. تضم التجهيزات الإضافية في هذا الفندق متاجر للهدايا/أكشاك للجرائد وقاعة رقص.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Al Mustafa، وهو واحد من 3 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بالاستفادة من خدمة الغرف على مدار 24 ساعة. أنهِ يومك بتناول مشروب مُنعش في البار/الاستراحة. يتم تقديم بوفيه فطور يوميًا من 6:30 صباحاً إلى 11 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال مفتوح 24 ساعة وجرائد مجانية في الردهة وفريق عمل يجيد التحدث بعدة لغات. هل تخطط لإقامة حدث ما في مكة المكرمة؟ تحتوي هذه المنشأة السياحة على مرافق احتفالات بمساحة 17761 قدم مربع (1650 متر مربع)، بما في ذلك مركز للمؤتمرات. يتاح خدمة مواقف السيارات لفترة محدودة داخل موقع المنشأة.&lt;/p&gt;",
