    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق كونكورد مِنى في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ٥ كم من بئر زمزم و ٥٫٩ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك عند الإقامة في واحدة من 940 غرفة مكيفة تتميز بوجود ثلاجات. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها أحواض استحمام أو حجيرات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تضم وسائل الراحة ماكينات صنع القهوة/الشاي وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً و المساعدة في تنظيم الجولات وحجز التذاكر وقاعة استقبال. يمكن للنزلاء الانتقال إلى المواقع القريبة بكل سهولة مع خدمة الحافلة المكوكية المجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;يمكنك زيارة مطعم يقع في هذا الفندق لتناول وجبة الغداء أو العشاء. كما تُقدَّم الوجبات أيضا في الكافيتيريا ويتم تأمين خدمة الغرف على مدار 24 ساعة. يتم تقديم بوفيه فطور يوميًا مقابل رسوم إضافية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة خدمة سريعة لإجراءات تسجيل الوصول وخدمة سريعة لإنهاء إجراءات المغادرة وجرائد مجانية في الردهة.&lt;/p&gt;",
