    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق الشريف في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق تضعك على بُعد ٦٫٧ كم من بئر زمزم و٩٫٢ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 200 غرفة/غرف ضيافة مكيفة، والتي تحتوي على ثلاجات وأجهزة ميكروويف. قم بتحضير وجباتك بنفسك في المطبخ العام/المشترك. يتم توفير تلفزيون بشاشة مسطحة تعرض قنوات فضائية من اجل متعتك، بالإضافة إلى اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تحتوي حمامات خاصة علىحوض استحمام عميق ومستلزمات مجانية للعناية الشخصية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة خدمة حمل الأمتعة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;تلذّذ بأشهى المأكولات لدى تناولك وجبة الغداء أو العشاء في مطعم هذا الفندق. كما يمكنك الإقامة هنا للاسترخاء في غرفتك والاستفادة من خدمة الغرف على مدار 24 ساعة. يتم تقديم إفطار أوروبي مجانًا يوميًا من 8 صباحاً إلى ظهراً.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة خدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة وخدمة تخزين الأمتعة. يتم تأمين حافلة للتوصيل من وإلى المطار لقاء تكلفة إضافية (متوفرة على مدار 24 ساعة)، وتتوفر أيضا مواقف سيارات مجانية قائمة على الخدمة الذاتية في مقر المنشأة.&lt;/p&gt;",
