    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن موقع فندق ناوازي واثير في مكة المكرمة يضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.   الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ٤٫٤ كم من أبراج البيت  و ٩٫٥ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 398 غرفة/غرف ضيافة مكيفة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تتوفر حمامات بها تجهيزات دش.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;تلذّذ بوجبة شهيّة في مطعم Al Rehab الذي يقدّم خدماته لنزلاء فندق ناوازي واثير. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
