    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إذا أقمت في قصر رافلز مكة، ستكون في مركز مكة المكرمة، على بُعد خطوات من بئر زمزم وعلى بُعد 5 دقائق بالسيارة من أبراج البيت .  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٤٫٩ كم من الكعبة و ٤٫٩ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 214 غرفة ضيافة بديكورات فريدة لكل منها، والتي تحتوي على وحدات شحن أجهزة آي بود ووحدات ميني بار. يتم توفير تلفزيونات إل إي دي 42 بوصة تعرض قنوات رقمية من أجل متعتك، كما تتوفر اتصال بالإنترنت اللاسلكية (نظير تكلفة إضافية) لتبقيك على اتصال دائمًا. تضم الغرف حمامات خاصة منفصلة بها أحواض استحمام أو حجيرات دش مع دُش غزير ومستلزمات مجانية للعناية الشخصية. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;دلل نفسك مع خدمات النادي الصحي المتكاملة مثل جلسات التدليك وعلاجات للجسم وعلاجات للوجه. إذا كنت تبحث عن فرص للاستجمام والترفيه، فستجد هنا نادي صحي وساونا. في هذا الفندق، ستجد وسائل راحة إضافية تشمل إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد ومتاجر للهدايا/أكشاك للجرائد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في مطعم Al Qasr، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا واستمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في 2 كافيتيريات. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سريعة لإجراءات تسجيل الوصول وخدمة سريعة لإنهاء إجراءات المغادرة. تضم هذه المنشأة السياحية 6 غرف اجتماعات متاحة للمناسبات.&lt;/p&gt;",
