    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إذا أقمت في فندق بولمان زمزم مكة، ستكون في مركز مكة المكرمة، على بُعد 1 دقيقة/دقائق بالسيارة من أبراج البيت  و8 دقيقة/دقائق من الكعبة.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٥ كم من الحرم المكي و ٥ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 1315 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيون بشاشة مسطحة. تحتوي الغرف على أسرّة بمراتب سيليكت كومفورت مع ملاءات من القطن المصري. تتوفر لك إمكانية الدخول على الإنترنت سلكيًا ولاسلكيًا مجانًا لتبقى على اتصال دائمًا، كما تتاح لك قنوات فضائية لمزيد من المتعة والترفيه. تضم الغرف حمامات خاصة بها أحواض استحمام أو حجيرات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وإمكانية التسوق داخل الموقع.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في مطعم Al Yasmine، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا واستمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتم تقديم بوفيه فطور يوميًا من 6:30 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة خدمة سيارات الليموزين ومكتب كمبيوتر وجرائد مجانية في الردهة.&lt;/p&gt;",
