    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق أبراج الصفوة – دار الغفران في مكة المكرمة تضعك على بُعد 15 دقيقة بالسيارة من أبراج البيت  ومكة مول.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٠٫١ كم من بئر زمزم و ١٠٫١ كم من الكعبة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 324 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيونات ذكية. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات باشتراك مدفوع من أجل متعتك. تضم الغرف حمامات خاصة بها وحدات دش مع أحواض استحمام مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تضم وسائل الراحة خزنات وماكينات صنع القهوة/الشاي، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم اتصال لاسلكي بالإنترنت (نظير تكلفة إضافية) وخدمات الاستعلامات والإرشاد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بوجبة في مطعم هذا الفندق  أو بتناول المأكولات الخفيفة في الكافيتيريا. كما يتم تأمين خدمة الغرف على مدار 24 ساعة. يتم تقديم بوفيه فطور يوميًا من 6:30 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وجرائد مجانية في الردهة وخدمة الغسيل/التنظيف الجاف. يتم تأمين حافلة للتوصيل من وإلى المطار لقاء تكلفة إضافية (متوفرة على مدار 24 ساعة)، وتتوفر أيضا صف السيارة بمعرفة النزيل (بتكلفة إضافية) في مقر المنشأة.&lt;/p&gt;",
