    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن موقع أبراج الميريديان مكة المكرمة في مكة المكرمة يضعك على بُعد 15 دقيقة بالسيارة من أبراج البيت  ومكة مول.   الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ١١ كم من الكعبة و ١١ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;دلل نفسك بالإقامة في واحدة من 1321 غرفة ضيافة مكيفة تحتوي على مطابخ مصغرة بها ثلاجات وأجهزة ميكروويف. يتم توفير تلفزيون إل سي دي تعرض قنوات فضائية من اجل متعتك، بالإضافة إلى اتصال سلكي بشبكة الإنترنت مجانا لتبقى على اتصال دائمًا. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وخدمة مجالسة/رعاية الأطفال (نظير تكلفة إضافية). في هذا الفندق حيث صُمّم البناء على طراز آرت ديكو، ستجد سماتٍ إضافية تشمل متاجر للهدايا/أكشاك للجرائد وخدمات لحفلات الزفاف وتلفزيون في ردهة الفندق. التنقل إلى المواقع القريبة سهل للغاية مع خدمة الحافلة المكوكية المجانية في تنقلاتهم، والتي تعمل في إطار مسافة 1700 متر.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول أطباق الشرق الأوسط في مطعم Middle East Restaurant، وهو واحد من 3 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بالاستفادة من خدمة الغرف على مدار 24 ساعة. يتم تقديم بوفيه فطور يوميًا من 4 صباحاً إلى 5 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة اتصال سلكي بشبكة الإنترنت مجانا ومركز لرجال الأعمال وخدمة سريعة لإجراءات تسجيل الوصول. يتم تأمين حافلة للتوصيل من وإلى المطار لقاء تكلفة إضافية (متوفرة عند الطلب)، وتتوفر أيضا مواقف سيارات مجانية قائمة على الخدمة الذاتية في مقر المنشأة.&lt;/p&gt;",
