    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في حياة ريجنسي مكة جبل عمر تضعك في قلب مكة المكرمة، على بُعد 10 دقائق سيرا من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٤٫٣ كم من أبراج البيت  و ٨٫٨ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 656 غرفة ضيافة مكيفة، والتي تحتوي على وحدات شحن أجهزة آي بود وتلفزيون بشاشة مسطحة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تضم الغرف حمامات خاصة بها أحواض استحمام وحجيرات دش منفصلة مع بيديه ومجففات شعر. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل نادي صحي أو تمتع بالاستفادة من وسائل الترفيه الأخرى المتاحة مثل إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد. تضم الميزات الإضافية في هذا الفندق متاجر للهدايا/أكشاك للجرائد وخدمات لحفلات الزفاف.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Al Oasis، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في 2 كافيتيريات. يتاح تقديم الإفطار يوميًا مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة اتصال سلكي بشبكة الإنترنت مجانا ومركز لرجال الأعمال وخدمة سريعة لإجراءات تسجيل الوصول. تضم مرافق المناسبات المتاحة في هذه المنشأة السياحية مركز للمؤتمرات وقاعة اجتماعات. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
