    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق قصر أجياد السد في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق تضعك على بُعد ٠٫٩ كم من بئر زمزم و٦٫٣ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 117 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيونات إل إي دي. يتم توفير تلفاز بقنوات باشتراك مدفوع من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات وستائر تعتيم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وتلفزيون في ردهة الفندق.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;تمتّع بتناول وجبة رائعة في المطعم الواقع في فندق قصر أجياد السد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مكتب استقبال مفتوح 24 ساعة وخدمة تخزين الأمتعة ومصعد.&lt;/p&gt;",
