    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق المنار في مكة المكرمة تضعك على بُعد 5 دقائق بالسيارة من الحرم المكي وبئر زمزم.  الإقامة في هذا الفندق تضعك على بُعد ٨٫٦ كم من الكعبة و٨٫٢ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك بالإقامة في واحدة من 260 غرفة مكيفة تتميز بوجود تلفزيون بشاشة مسطحة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات باشتراك مدفوع من أجل متعتك. تضم الغرف حمامات خاصة بها أحواض استحمام أو حجيرات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تضم وسائل الراحة خزنات وخدمة ترتيب الأسرّة، وتتوفر خدمة تدبير الغرف عند الطلب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بمشاهدة المناظر المتاحة من الحديقة وتمتع باستخدام وسائل الراحة المتوفرة مثل إنترنت لاسلكي مجاناً.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة التي تقدمها المنشأة.&lt;/p&gt;",
