    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في  إنتركونتننتال دار التوحيد مكة المكرمة تضعك في قلب مكة المكرمة، على بُعد 10 دقائق سيرا من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٤٫٣ كم من أبراج البيت  و ٨٫٨ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 600 غرفة/غرف ضيافة مكيفة، والتي تحتوي على ثلاجات ووحدات ميني بار. يتم توفير تلفزيون بلازما تعرض قنوات باشتراك مدفوع من اجل متعتك، بالإضافة إلى اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تضم الغرف حمامات خاصة بها وحدات دش مع أحواض استحمام مع مستلزمات مجانية للعناية الشخصية وبيديه. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وصالة ألعاب للأطفال/ألعاب إلكترونية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في مطعم Ladies Lounge، وهو واحد من 5 مطاعم موجودة في هذا الفندق، أو أقم هنا واستمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتاح تقديم الإفطار يوميًا من 6 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سيارات الليموزين وخدمة الغسيل/التنظيف الجاف. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
