    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن موقع فندق مبارك بلازا مكة المكرمة في مكة المكرمة يضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.   الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ٠٫٦ كم من أبراج البيت  و ١٠٫٢ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك بالإقامة في واحدة من 383 غرفة مكيفة تتميز بوجود تلفزيون إل سي دي. يتم توفير تلفاز بقنوات فضائية من أجل متعتك. تضم الحمامات وحدات دش مع أحواض استحمام ومجففات شعر. تضم وسائل الراحة المتاحة خزنات وماكينات صنع القهوة/الشاي، بالإضافة إلى هواتف بخدمة إمكانية إجراء المكالمات المحلية مجانًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وتلفزيون في ردهة الفندق.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا واستمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتاح تقديم الإفطار مقابل رسوم إضافية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الراحة المتاحة تجهيزات لغسل الملابس ومصعد. هل تخطط لإقامة حدث ما في مكة المكرمة؟ تحتوي هذه المنشأة السياحة على مرافق احتفالات بمساحة 5382 قدم مربع (500 متر مربع)، بما في ذلك مركز للمؤتمرات وقاعة اجتماعات. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
