    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق مكارم البيت في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ٥٫١ كم من بئر زمزم و ٨٫١ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 270 غرفة ضيافة مكيفة تحتوي على مدافئ وتلفزيون إل سي دي. تحتوي الغرفة على سرير بمرتبة سيليكت كومفورت. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تضم وسائل الراحة خزنات وماكينات صنع القهوة/الشاي، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً ومتاجر للهدايا/أكشاك للجرائد وتلفزيون في ردهة الفندق. التنقل إلى المواقع القريبة سهل للغاية مع خدمة الحافلة المكوكية المجانية في تنقلاتهم، والتي تعمل في إطار مسافة 3 كلم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في واحد من الأماكن العديدة المُخصصة لتناول الطعام في هذا الفندق، والتي تشمل 2 مطاعم وكافيتيريا. يتاح تقديم فطور أوروبي مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سيارات الليموزين وخدمة الغسيل/التنظيف الجاف. تضم هذه المنشأة السياحية 5 غرف اجتماعات متاحة للمناسبات. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
