    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن إقامتك في المروة ريحان من روتانا تضعك في قلب مدينة مكة المكرمة، على بُعد 9 دقيقة/دقائق بالسيارة من أبراج البيت  و13 دقيقة/دقائق من مدينة الملك عبد الله الطبية.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٨٫٨ كم من مكة مول و١٠٫١ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 516 غرفة ضيافة مكيفة تحتوي على مدافئ وتلفزيون بشاشة مسطحة. يتم توفير تلفاز بقنوات فضائية من أجل متعتك. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات تتّسع لتخزين الكمبيوتر المحمول ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وإمكانية التسوق داخل الموقع.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Al Bayt، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سيارات الليموزين وجرائد مجانية في الردهة. يتم تأمين حافلة للتوصيل من وإلى المطار لقاء تكلفة إضافية (متوفرة على مدار 24 ساعة)، وتتوفر أيضا صف السيارة بمعرفة النزيل (بتكلفة إضافية) في مقر المنشأة.&lt;/p&gt;",
