    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق درة الأصيل في مكة المكرمة تضعك على بُعد 5 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذه الشقة الفندقية تضعك على بُعد ٣٫٣ كم من بئر زمزم و٦٫٤ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;دلل نفسك بالإقامة في واحدة من 300 غرفة ضيافة مكيفة تحتوي على مطابخ مصغرة بها ثلاجات ومواقد طهي مسطحة. يتم توفير تلفزيونات إل إي دي تعرض قنوات باشتراك مدفوع من اجل متعتك، بالإضافة إلى اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات وغلايات كهربية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذه الشقق الفندقية، تؤمّن المنشأة خدمة حمل الأمتعة ومناطق مخصصة للمدخنين.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة التي تقدمها المنشأة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الراحة المتاحة مكتب استقبال مفتوح 24 ساعة ومصعد.&lt;/p&gt;",
