    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إذا أقمت في هوليداي إن، مكة، العزيزية، ستكون في مركز مكة المكرمة، على بُعد 10 دقائق بالسيارة عن الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٤٫٣ كم من بئر زمزم و ٦٫٣ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 1226 غرفة ضيافة مكيفة، والتي تحتوي على وحدات شحن أجهزة آي بود وتلفزيون بشاشة مسطحة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها أحواض استحمام وحجيرات دش منفصلة مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بالاسترخاء في واحد من 2 من حمامات السباحة المغطاة أو تمتع باستخدام وسائل الراحة والاستجمام الأخرى مثل نادي صحي. في هذا الفندق، ستجد سماتٍ إضافية منها إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وخدمة مجالسة/رعاية الأطفال مجانا. يمكن للنزلاء الانتقال إلى المواقع القريبة بكل سهولة مع خدمة الحافلة المكوكية المجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في مطعم Al Merkaz، وهو واحد من 3 مطاعم موجودة في هذا الفندق، أو أقم هنا واستمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في 2 كافيتيريات. يتاح تقديم الإفطار يوميًا مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة خدمة سيارات الليموزين وخدمة الغسيل/التنظيف الجاف وفريق عمل يجيد التحدث بعدة لغات. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
