    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق البطل في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق تضعك على بُعد ٠٫٧ كم من بئر زمزم و٤٫٣ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك بالإقامة في واحدة من 19 غرفة مكيفة تتميز بوجود تلفزيون بشاشة مسطحة. يتم توفير تلفاز بقنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية وبرانس (أردية) حمّام. تضم وسائل الراحة المتاحة هواتف، ويمكن توفير خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة مناطق مخصصة للمدخنين.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;يتاح خدمة فاليه باركينج مجانية لركن السيارات داخل موقع المنشأة.&lt;/p&gt;",
