    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في ايبيس ستايلس مكة بمدينة مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من مسجد فقيه والصفا والمروة.  استمتع بالإقامة في هذا الفندق على بُعد ٥٫٣ كم من بئر زمزم و٥٫٣ كم من الكعبة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 286 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيون بشاشة مسطحة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الحمامات تجهيزات دش ومجففات شعر. تضم وسائل الراحة خزنات ومكاتب، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد ومدفأة في الردهة. يمكن للنزلاء الانتقال إلى المواقع القريبة مع خدمة الحافلة المكوكية المجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;دلل نفسك بتناول وجبة رائعة في واحد من 2 مطاعم متاحة في المنشأة. يتم تقديم بوفيه فطور يوميًا من 6:30 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سريعة لإجراءات تسجيل الوصول وجرائد مجانية في الردهة. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
