    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن موقع فندق إنفينيتي مكة في مكة المكرمة يضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.   الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٠٫٩ كم من بئر زمزم و ٣٫٦ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك عند الإقامة في واحدة من 810 غرفة مكيفة تتميز بوجود وحدات ميني بار. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات باشتراك مدفوع من أجل متعتك. تضم الحمامات تجهيزات دش ومستلزمات مجانية للعناية الشخصية. تضم وسائل الراحة خزنات ومكاتب، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وقاعة استقبال.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم All Day Dinning، وهو واحد من 3 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتم تقديم بوفيه إفطار مجانًا يوميًا من 6 صباحاً إلى 10:30 صباحاً.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وجرائد مجانية في الردهة ومكتب استقبال مفتوح 24 ساعة. يتم توفير حافلة للتوصيل من وإلى المطار مقابل تكلفة إضافية (متوفرة على مدار 24 ساعة).&lt;/p&gt;",
