    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق الدار البيضاء تكامل في مكة المكرمة تضعك على بُعد 15 دقيقة بالسيارة من أبراج البيت  ومكة مول.  الإقامة في هذا الفندق تضعك على بُعد ١٣٫٥ كم من الكعبة و١٣٫٥ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 320 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيونات إل إي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تحتوي حمامات خاصة على وحدات دش مع أحواض استحمام بها حوض استحمام عميق ومستلزمات مجانية للعناية الشخصية. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات وستائر تعتيم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة خدمة حمل الأمتعة ومناطق مخصصة للمدخنين.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;تلذّذ بأشهى المأكولات لدى تناولك وجبة الغداء أو العشاء في  Casablanca، وهو مطعم مُختص بتقديم الأطباق العالمية. كما يمكنك الإقامة هنا للاسترخاء في غرفتك والاستفادة من خدمة الغرف على مدار 24 ساعة. يتم تقديم إفطار أوروبي مجانًا يوميًا من 6 صباحاً إلى 10:30 صباحاً.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
