    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن موقع فندق رويال دار الإيمان في مكة المكرمة يضعك على بُعد 15 دقيقة بالسيارة من أبراج البيت  ومكة مول.   الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٠٫٥ كم من بئر زمزم و ١٠ كم من الكعبة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 810 غرفة/غرف ضيافة مكيفة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تتوفر حمامات بها أحواض استحمام أو حجيرات دش. تضم وسائل الراحة المتاحة هواتف وستائر تعتيم، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً و المساعدة في تنظيم الجولات وحجز التذاكر.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بوجبة في مطعم هذا الفندق  أو بتناول المأكولات الخفيفة في الكافيتيريا. كما يتم تأمين خدمة الغرف على مدار 24 ساعة. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال مفتوح 24 ساعة وخدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
