    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند إقامتك في فندق برج ساعة مكة الملكي فيرمونت، ستكون في وسط مكة المكرمة، على بعد 9 دقيقة/دقائق مشيا من بوابة الملك فهد و12 دقيقة/دقائق سيرا على الأقدام من أبراج البيت .  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٧٫٩ كم من مسجد فقيه و٩٫٩ كم من الصفا والمروة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 1650 غرفة ضيافة بديكورات فريدة لكل منها، والتي تحتوي على وحدات ميني بار وتلفزيون إل سي دي. تحتوي الغرف على أسرّة بمراتب سيليكت كومفورت مع ملاءات من القطن المصري. تتاح لك اتصال بالإنترنت اللاسلكية (نظير تكلفة إضافية) لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع دُش غزير ومستلزمات فاخرة للعناية الشخصية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;أطلق العنان للاستمتاع والاسترخاء مع خدمات النادي الصحي المتكاملة المتاحة مثل جلسات التدليك. في هذا الفندق حيث صُمّم البناء على طراز آرت ديكو، ستجد سماتٍ إضافية تشمل إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد ومتاجر للهدايا/أكشاك للجرائد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Atyaf، وهو واحد من 10 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتم تقديم بوفيه فطور يوميًا من 7:30 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سيارات الليموزين وجرائد مجانية في الردهة. هل تخطط لإقامة حدث ما في مكة المكرمة؟ تحتوي هذه المنشأة السياحة على مرافق احتفالات بمساحة 23378 قدم مربع (2172 متر مربع)، بما في ذلك مركز للمؤتمرات.&lt;/p&gt;",
