    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق بارك إن من راديسون، مكة النسيم في مكة المكرمة تضعك على بُعد 10 دقائق بالسيارة من مكة مول وجامع الراجحي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ١١٫١ كم من الكعبة و ١١٫١ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 459 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيون إل سي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تضم وسائل الراحة خزنات ومكاتب، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل نادي صحي أو تمتع بمشاهدة المنظر من شرفة  في الدور العلوي. في هذا الفندق، ستجد سماتٍ إضافية منها إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وتلفزيون في ردهة الفندق. يمكن للنزلاء الانتقال إلى المواقع القريبة مع خدمة الحافلة المكوكية المجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بوجبة في مطعم هذا الفندق  أو بتناول المأكولات الخفيفة في الكافيتيريا. كما يتم تأمين خدمة الغرف على مدار 24 ساعة. تحتاج إلى بعض الاسترخاء؟ خُذ قسطا من الراحة وتناول مشروبا لذيذا في 2 بارات. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وجرائد مجانية في الردهة وخدمة الغسيل/التنظيف الجاف. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
