    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عندما تقيم في فندق إيلاف بكة في مكة المكرمة، ستكون في منشأة في حي التسوق، على بُعد 10 دقائق بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ٣٫٢ كم من بئر زمزم و ٧٫٥ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 810 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيون بشاشة مسطحة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تضم وسائل الراحة خزنات ومكاتب، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وصالون لتصفيف الشعر. في هذا الفندق حيث صُمّم البناء على طراز آرت ديكو، ستجد سماتٍ إضافية تشمل إمكانية التسوق داخل الموقع وتلفزيون في ردهة الفندق.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Al Safa Restaurant، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في 2 كافيتيريات. أنهِ يومك بتناول مشروب مُنعش في البار/الاستراحة. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سريعة لإجراءات تسجيل الوصول وخدمة سريعة لإنهاء إجراءات المغادرة. إذا كنت تخطط لإقامة حدث ما في مكة المكرمة، فإن هذه المنشأة السياحة تحتوي على مرافق احتفالات بمساحة 1291 قدم مربع (120 متر مربع). يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
