    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق فلسطين مكة في مكة المكرمة تضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ٠٫٩ كم من أبراج البيت  و ٩٫٩ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 565 غرفة/غرف ضيافة مكيفة، والتي تحتوي على ثلاجات ووحدات ميني بار. يتم توفير تلفزيون إل سي دي تعرض قنوات باشتراك مدفوع من اجل متعتك، بالإضافة إلى اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تضم الحمامات أحواض استحمام أو حجيرات دش ومجففات شعر. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وقاعة ولائم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;في هذا الفندق، يتم تقديم المأكولات في الكافيتيريا حيث يمكنك الاستمتاع بوجبة شهية، أو قد تود الإقامة والاستفادة من خدمة الغرف على مدار 24 ساعة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة.&lt;/p&gt;",
