    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند الإقامة في فندق ماسة المهند، الروضة في مكة المكرمة، ستكون على بُعد 10 دقائق بالسيارة من الحرم المكي والكعبة.  الإقامة في هذا الفندق تضعك على بُعد ٦٫١ كم من بئر زمزم و٨٫٨ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 54 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيونات إل إي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تحتوي حمامات خاصة على وحدات دش مع أحواض استحمام بها حوض استحمام عميق ومستلزمات مجانية للعناية الشخصية. تضم وسائل الراحة غلايات كهربية وغسالات/مجففات، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;في هذا الفندق، تؤمّن المنشأة خدمة حمل الأمتعة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;في هذا الفندق، يتم تقديم المأكولات في الكافيتيريا حيث يمكنك الاستمتاع بوجبة شهية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مكتب استقبال مفتوح 24 ساعة وخدمة تخزين الأمتعة وخزانة للأمانات في مكتب الاستقبال. يتم تأمين حافلة للتوصيل من وإلى المطار لقاء تكلفة إضافية (متوفرة على مدار 24 ساعة)، وتتوفر أيضا خدمة مواقف السيارات لفترة محدودة في مقر المنشأة.&lt;/p&gt;",
