    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إن موقع فندق دار الإيمان جراند في مكة المكرمة يضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.   الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٠٫٨ كم من أبراج البيت  و ١٠٫١ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك بالإقامة في واحدة من 895 غرفة مكيفة تتميز بوجود تلفزيون بلازما. يتم توفير تلفاز بقنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية وبرانس (أردية) حمّام. تضم وسائل الراحة خزنات وغلايات كهربية، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Royal، وهو واحد من 4 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بالاستفادة من خدمة الغرف على مدار 24 ساعة. يتاح تقديم الإفطار مقابل رسوم إضافية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الراحة المتاحة مكتب استقبال مفتوح 24 ساعة ومصعد. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
