    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في هيلتون مكة للأجنحة الفندقية تضعك في قلب مكة المكرمة، على بُعد 10 دقائق سيرا من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٤٫٣ كم من أبراج البيت  و ٨٫٨ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 484 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيون إل سي دي. يتم توفير قنوات بريميوم ووحدات شحن أجهزة إم بي ثري من أجل مزيد من المتعة والترفيه. تضم الغرف حمامات خاصة بها تجهيزات دش مع دُش غزير ومستلزمات مجانية للعناية الشخصية. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات تتّسع لتخزين الكمبيوتر المحمول وجرائد مجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل صالة لياقة بدنية مفتوحة 24 ساعة أو تمتع بالاستفادة من وسائل الترفيه الأخرى المتاحة مثل خدمات الاستعلامات والإرشاد ومتاجر للهدايا/أكشاك للجرائد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;توقّف لتناول وجبة سريعة في مطعم Al-Kawkab Cafe، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا واستمتع بالاستفادة من خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في 3 كافيتيريات. استمتع بتناول شرابك المفضل في البار/الاستراحة. يتم تقديم بوفيه فطور يوميًا من 7 صباحاً إلى 11 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال مفتوح 24 ساعة وجرائد مجانية في الردهة ومكتب استقبال مفتوح 24 ساعة. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
