    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إذا أقمت في كونراد مكة المكرمة، ستكون في مركز مكة المكرمة، على بُعد 15 دقيقة بالسيارة عن الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٢ كم من أبراج البيت  و ٦٫٥ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;تمتع بالإقامة في واحدة من 438 غرفة/غرف الضيافة التي تحتوي على تلفزيون إل سي دي. تتوفر لك إمكانية الدخول على الإنترنت سلكيًا ولاسلكيًا مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى عرض قنوات بريميوم من أجل متعتك. تضم الغرف حمامات خاصة بها مستلزمات مجانية للعناية الشخصية وبيديه. تضم وسائل الراحة خزنات تتّسع لتخزين الكمبيوتر المحمول وجرائد مجانية، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل صالة لياقة بدنية مفتوحة 24 ساعة أو تمتع بالاستفادة من وسائل الترفيه الأخرى المتاحة مثل إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Al Mearaj، وهو واحد من 4 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في 2 كافيتيريات. يتاح تقديم بوفيه فطور مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة اتصال سلكي بشبكة الإنترنت مجانا ومركز لرجال الأعمال وخدمة الغسيل/التنظيف الجاف. تضم هذه المنشأة السياحية 2 غرف اجتماعات متاحة للمناسبات. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
