    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق مكارم أم القرى في مكة المكرمة تضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٢٫٦ كم من أبراج البيت  و ١٠٫١ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 336 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيون إل سي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية وبيديه. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد ومتاجر للهدايا/أكشاك للجرائد. يمكن للنزلاء الانتقال إلى المواقع القريبة مع خدمة الحافلة المكوكية المجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;تلذّذ بأشهى المأكولات لدى تناولك وجبة الغداء في Al Taai Restaurant، وهو مطعم يقع في هذا الفندق. كما يمكنك الإقامة هنا للاسترخاء في غرفتك والاستفادة من خدمة الغرف على مدار 24 ساعة.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال مفتوح 24 ساعة وخدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة. تضم هذه المنشأة السياحية 5 غرف اجتماعات متاحة للمناسبات. يتاح مواقف سيارات مجانية قائمة على الخدمة الذاتية داخل موقع المنشأة.&lt;/p&gt;",
