    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إذا أقمت في فندق سويسوتل مكة المكرمة، ستكون في مركز مكة المكرمة، على بُعد 10 دقائق بالسيارة عن الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٠٫١ كم من بئر زمزم و ٤٫٦ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 1487 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيون إل سي دي. تتاح لك اتصال بالإنترنت اللاسلكية (نظير تكلفة إضافية) لتبقى على اتصال دائمًا، بالإضافة إلى قنوات رقمية من أجل متعتك. تضم الغرف حمامات خاصة بها أحواض استحمام أو حجيرات دش مع مستلزمات مجانية للعناية الشخصية وبيديه. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد ومتاجر للهدايا/أكشاك للجرائد. في هذا الفندق حيث صُمّم البناء على طراز آرت ديكو، ستجد سماتٍ إضافية تشمل صالون لتصفيف الشعر وتلفزيون في ردهة الفندق وقاعة ولائم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول أطباق البحر المتوسط في مطعم Ajwaa Restaurant، وهو واحد من 3 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بالاستفادة من خدمة الغرف على مدار 24 ساعة. أنهِ يومك بتناول مشروب مُنعش في البار/الاستراحة. يتم تقديم بوفيه فطور يوميًا من 6 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سريعة لإجراءات تسجيل الوصول وخدمة سريعة لإنهاء إجراءات المغادرة.&lt;/p&gt;",
