    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;عند إقامتك في درنف هوتل مكة بمدينة مكة المكرمة، ستكون على بُعد ٤٫١ كم من أبراج البيت  و١٤٫٣ كم من بئر زمزم.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ١٤٫٣ كم من الكعبة و١٤٫٣ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 86 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيونات إل إي دي. تحتوي الغرف على أسرّة بمراتب سيليكت كومفورت مع ملاءات من القطن المصري. يتم توفير تلفاز بقنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل صالة لياقة بدنية أو تمتع بالاستفادة من وسائل الترفيه الأخرى المتاحة مثل إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد. في هذا الفندق، ستجد سماتٍ إضافية تشمل متاجر للهدايا/أكشاك للجرائد وصالون لتصفيف الشعر وخدمات لحفلات الزفاف. يمكن للنزلاء الاستفادة من خدمة الحافلة المكوكية المجانية في تنقلاتهم، والتي تعمل في إطار مسافة 10 كلم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;لتناول وجبة الغداء أو العشاء، قم بزيارة Al Tilal Restaurant وهو مطعم مُختص بتقديم الأطباق العالمية. كما تُقدَّم الوجبات أيضا في الكافيتيريا، وتؤمّن المنشأة خدمة الغرف (خلال ساعات محدودة). يتم تقديم بوفيه فطور يوميًا من 7 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وخدمة سريعة لإجراءات تسجيل الوصول وخدمة سريعة لإنهاء إجراءات المغادرة. هل تخطط لإقامة حدث ما في مكة المكرمة؟ تحتوي هذه المنشأة السياحة على مرافق احتفالات بمساحة 258 قدم مربع (24 متر مربع)، بما في ذلك قاعة اجتماعات. يتاح مواقف للكرافانات/ الحافلات/ الشاحنات داخل موقع المنشأة.&lt;/p&gt;",
