    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق الدانة الماسية مكة المكرمة في مكة المكرمة تضعك على بُعد 5 دقائق بالسيارة من الحرم المكي وبئر زمزم.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 4 نجوم، تضعك على بُعد ٤٫٦ كم من الكعبة و ٧٫٢ كم من مكة مول.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 611 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيون بشاشة مسطحة. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية وبيديه. تضم وسائل الراحة خزنات ومكاتب، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وقاعة رقص.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بوجبة في مطعم هذا الفندق، أو أقم هنا للاسترخاء والاستفادة من خدمة الغرف (خلال ساعات محدودة). يتم تقديم فطور أوروبي يوميًا من 6:30 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال مفتوح 24 ساعة وخدمة سريعة لإجراءات تسجيل الوصول وخدمة سريعة لإنهاء إجراءات المغادرة. يتاح خدمة مواقف السيارات لفترة محدودة داخل موقع المنشأة.&lt;/p&gt;",
