    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;لدى الإقامة في فندق المرجان كروم في مكة المكرمة (شارع الستون)، ستكون على بُعد خمس دقائق بالسيارة من الحرم المكي وأبراج البيت .  الإقامة في هذا الفندق تضعك على بُعد ٨٫٩ كم من الكعبة و٥٫٣ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في بيتك بالإقامة في واحدة من 304 غرفة مكيفة تتميز بوجود تلفزيون إل سي دي. يتم توفير تلفاز بقنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بوجبة في مطعم المطعم الرئيسي أو بتناول المأكولات الخفيفة في الكافيتيريا. كما يتم تقديم خدمة الغرف على مدار 24 ساعة في هذا الفندق. يتم تقديم بوفيه فطور يوميًا من 6:30 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مكتب استقبال مفتوح 24 ساعة وفريق عمل يجيد التحدث بعدة لغات وقهوة/شاي في منطقة مشتركة.&lt;/p&gt;",
