    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في إم هوتل مكة باي ميلينيوم في مكة المكرمة تضعك على بُعد 15 دقيقة بالسيارة من أبراج البيت  ومكة مول.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ١١٫٢ كم من الكعبة و ١١٫٣ كم من الحرم المكي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 785 غرفة ضيافة مكيفة، والتي تحتوي على وحدات ميني بار وتلفزيونات إل إي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات باشتراك مدفوع من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع دُش غزير ومستلزمات مجانية للعناية الشخصية. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات ومكاتب.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد وخدمات لحفلات الزفاف. في هذا الفندق، ستجد سماتٍ منها تلفزيون في ردهة الفندق وقاعة ولائم. يمكن للنزلاء الانتقال إلى المواقع القريبة بكل سهولة مع خدمة الحافلة المكوكية المجانية.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;لتناول وجبة الغداء أو العشاء، قم بزيارة Tasneem Restaurant وهو مطعم مُختص بتقديم الأطباق العالمية. كما تُقدَّم الوجبات أيضا في الكافيتيريا، وتؤمّن المنشأة خدمة الغرف على مدار 24 ساعة. يتم تقديم بوفيه فطور يوميًا من 7:30 صباحاً إلى 10:30 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة جرائد مجانية في الردهة وخدمة الغسيل/التنظيف الجاف ومكتب استقبال مفتوح 24 ساعة. يتاح خدمة فاليه باركينج مجانية لركن السيارات داخل موقع المنشأة.&lt;/p&gt;",
