    "cityName": "مكة المكرمة",
    "countryName": "المملكة العربية السعودية",
    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;إذا أقمت في فندق إيلاف المشاعر، ستكون في مركز مكة المكرمة، على بُعد 15 دقيقة بالسيارة عن الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٠٫٥ كم من بئر زمزم و ٤٫١ كم من أبراج البيت .&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 304 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيونات إل إي دي. تتاح لك اتصال سلكي بشبكة الإنترنت مجانا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات باشتراك مدفوع من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تضم وسائل الراحة خزنات تتّسع لتخزين الكمبيوتر المحمول وماكينات صنع القهوة/الشاي، وتتوفر خدمة تدبير الغرف يوميًا.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;تمتع بوسائل الراحة المتاحة في هذه المنشأة والتي تضم إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق الآسيوية في مطعم Al Multazim، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتم تقديم بوفيه فطور يوميًا من 7 صباحاً إلى 10 صباحاً مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وجرائد مجانية في الردهة وخدمة الغسيل/التنظيف الجاف. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
