    "description": "&lt;p&gt;&lt;b&gt;موقع المنشأة&lt;/b&gt; &lt;br /&gt;الإقامة في فندق جراند مكة في مكة المكرمة تضعك على بُعد 15 دقيقة بالسيارة من الكعبة والحرم المكي.  الإقامة في هذا الفندق، منشأة تتّسم بتصنيف 5 نجوم، تضعك على بُعد ٧٫٤ كم من أبراج البيت  و ٨٫٣ كم من بئر زمزم.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الغرف&lt;/b&gt; &lt;br /&gt;اشعر وكأنك في منزلك عند الإقامة في واحدة من 1387 غرفة ضيافة مكيفة، والتي تحتوي على ثلاجات وتلفزيونات إل إي دي. تتاح لك اتصال لاسلكي بالإنترنت مجانًا لتبقى على اتصال دائمًا، بالإضافة إلى قنوات فضائية من أجل متعتك. تضم الغرف حمامات خاصة بها تجهيزات دش مع مستلزمات مجانية للعناية الشخصية ومجففات شعر. تشتمل وسائل الراحة المتاحة على هواتف، بالإضافة إلى خزنات وماكينات صنع القهوة/الشاي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;الخدمات الترفيهية&lt;/b&gt; &lt;br /&gt;استمتع بفرص الترفيه المتاحة مثل صالة لياقة بدنية أو تمتع بالاستفادة من وسائل الترفيه الأخرى المتاحة مثل إنترنت لاسلكي مجاناً وخدمات الاستعلامات والإرشاد.&lt;/p&gt;&lt;p&gt;&lt;b&gt;تناول الطعام&lt;/b&gt; &lt;br /&gt;استمتع بتناول الأطباق العالمية في مطعم Hejazi، وهو واحد من 2 مطاعم موجودة في هذا الفندق، أو أقم هنا وتمتّع بميزة خدمة الغرف على مدار 24 ساعة. وهناك أيضا وجبات خفيفة متوفرة في الكافيتيريا. يتاح تقديم الإفطار يوميًا مقابل رسم إضافي.&lt;/p&gt;&lt;p&gt;&lt;b&gt;خدمات الأعمال ووسائل الراحة الأخرى&lt;/b&gt; &lt;br /&gt;تضم وسائل الرائحة المميزة مركز لرجال الأعمال وجرائد مجانية في الردهة وخدمة الغسيل/التنظيف الجاف. هل تخطط لإقامة حدث ما في مكة المكرمة؟ تحتوي هذه المنشأة السياحة على مرافق احتفالات بمساحة 5382 قدم مربع (500 متر مربع)، بما في ذلك قاعة مؤتمرات وقاعة اجتماعات. يتاح صف السيارة بمعرفة النزيل (بتكلفة إضافية) داخل موقع المنشأة.&lt;/p&gt;",
